import {Component} from 'react'
import './index.css'
import Boolean from '../boolean/index'
import Spelling from '../spelling/index'

class Header extends Component{
    state = {
        b : true,
    }

    booleanFunction = () => {
        this.setState({b:true})
    }

    spellingFunction = () =>{
        this.setState({b:false})
    }

    render(){
        const {b} = this.state
        return (
            <div>
                <div className="nav">
                <div className="navElements">
                    <p onClick={this.booleanFunction} className={b?"yes":"no"}>Boolean retrieval model</p>
                </div>
                <div className="navElements" >
                    <p onClick={this.spellingFunction} className={b?"no":"yes"}>spelling correction</p>
                </div>
            </div>
            {b?<Boolean/>:<Spelling/>}

            </div>
        )
    }
}

export default Header;
